function callObjectByKey(key, value) {
    data2 = car_data.filter(function (car) {
        var values = Object.values(car);
        var keys = Object.keys(car);
        if (values.includes(value) && keys.includes(key)) {
            return car;
        }
    });
    return data2;
}
